import React from "react";
import Button from "../Button/Button";
import "./PopUpWin.css";

const PopUpWin=(props)=>{

    return(        
        <div className="popup">
            <div>{props.title}</div>
            <div className="content ">{props.content}</div>
            <div><Button name={props.buttonName}/></div>
        </div>
    );
}

export default PopUpWin;
